import React from "react";

function Alert({ data }) {
  const alerts = data.map((alert) => (
    <div key={alert.id} className={`alert alert-${alert.res.alertType}`}>
      {alert.res.msg}
    </div>
  ));

  return <div>{alerts}</div>;
}

export default Alert;
